import React from "react";
import "../css/Profile.css"; 

const Profile = () => {
  return (
    <div className="profile-page">
      {/* Header Section */}
      <header className="header">
        <div className="logo">
          <img
            src="https://i.pinimg.com/736x/0f/b1/74/0fb1749fd4fe5efe880cc10665f97828.jpg" 
            alt="VoyageCraft Logo"
            className="logo-image"
          />
          <span className="logo-text">VoyageCraft</span>
        </div>
        <div className="auth-buttons">
          <button className="login-button">Log in</button>
          <button className="register-button">Sign up</button>
        </div>
      </header>

      <div className="center-photo">
        <img
          src="https://media.cntraveler.com/photos/56c73b9bdfe20b0a282a75e8/16:9/w_2240,c_limit/yosemite-firefall-cr-alamy.jpg" 
          alt="Center Photo"
          className="big-photo"
        />
      </div>
    </div>
  );
};

export default Profile;
